import React from 'react';
import Appartment from './Appartment';
import { array, func } from 'prop-types';

// const AppartementList = () => (
//   <div>
//     <p>AppartementList.js</p>
//   </div>
// );

const AppartementList = ({ appartements, favorites, toggleFav }) => (
  <div>
    {appartements.map(el =>
      <Appartment
        key={el.id}
        appartement={el}
        favorites={favorites}
        toggleFav={toggleFav}
      />
    )}
  </div>
)

export default AppartementList

AppartementList.propTypes = {
  appartments: array.isRequired,
  favorites: array.isRequired,
  toggleFav: func.isRequired
}
